import React from 'react';
import ReactDOM from 'react-dom';
import {App} from './components/App';
import {BrowserRouter, Route} from 'react-route-dom';

ReactDOM.render(
  <BrowserRouter>
    <Route path='/' component={App}/>
  </BrowserRouter>
,document.getElementById('root'));
